, his inner world took over. “At first, I was being really productive with club music. But then after a while I started making something completely opposite.” Yotto found himself exploring a different form of expression, with no plan other than to create. But when he put the tracks side-by-side in a playlist he recognised a synergy, and the outline of the project began to take shape. The result is more of a continuous soundscape than an album; an ethereal and dreamy experience designed to accompany the listener as they turn inward and drift away. If club music is a form of escape, then this is too – but instead of turning outward, we lose ourselves inward.logseq____&quot;,536870956]],[logseq____&quot;^15logseq____&quot;,[1479,logseq____&quot;^Ologseq____&quot;,logseq____&quot;^16logseq____&quot;,536870956]],[logseq____&quot;^15logseq____&quot;,[1479,logseq____&quot;^Flogseq____&quot;,1478,536870956]],[logseq____&quot;^15logseq____&quot;,[1479,logseq____&quot;^Xlogseq____&quot;,523,536870956]],[logseq____&quot;^15logseq____&quot;,[1479,logseq____&quot;^Vlogseq____&quot;,523,536870956]],[logseq____&quot;^15logseq____&quot;,[1479,logseq____&quot;^Ulogseq____&quot;,523,536870956]],[logseq____&quot;^15logseq____&quot;,[1479,logseq____&quot;^Ulogseq____&quot;,1476,536870956]],[logseq____&quot;^15logseq____&quot;,[1479,logseq____&quot;^Hlogseq____&quot;,1476,536870956]],[logseq____&quot;^15logseq____&quot;,[1479,logseq____&quot;^;logseq____&quot;,logseq____&quot;~u67135cb8-541c-4d9b-9e95-36538d02a643logseq____&quot;,536870956]],[logseq____&quot;^15logseq____&quot;,[1480,logseq____&quot;^Qlogseq____&quot;,logseq____&quot;The first single is ‘Silhouette’. It’s a melancholy, atmospheric track with hints of ’80s nostalgia and smooth as glass vocals from Sansa. The track conjures up images of vast and endless landscapes; the sense of space enhanced by sparse chord-changes and field recordings of heavy rain. ‘Silhouette’ is so human it feels like an extension of an emotion, and
